import React from 'react'
import styled from "styled-components"

const Container = styled.div`
  height:100%;
  overflow-y:scroll;
  backgroung:${({theme})=>theme.bg};
  padding:30px 30px;
  padding-bottom:50px;
  display:flex;
  flex-direction:column;
  align-items:center;
  gap:20px;
  @media (max-width:768px){
  padding: 6px 10px;};

  `;
  const Wrapper = styled.div`
  flex:1;
  height:fit-coontent;
  max-width:1200px;
  
  gap:8%;
  display: flex;
  justify-content:center;
  @media(max-width: 768px){
    flex-direction: column}
`;
const CreatePost = () => {
  return (
    <Container><Wrapper>CreatePost</Wrapper></Container>
  )
}

export default CreatePost;
